import React from 'react';
import Story from './Story';
import "./StoryReel.css";


function StoryReel() {
    return (
        <div className="storyReel">
            <Story image="" profileSrc="" title="Tedane Blake" />
            <Story image="" profileSrc="" title="Emily Blake" />
            <Story image="" profileSrc="" title="Chasity Blake" />
            <Story image="" profileSrc="" title="Comarsh Blake" />
            <Story image="" profileSrc="" title="Tequan Blake" />
            <Story image="" profileSrc="" title="Atetra Blake" />
        </div>
    )
}

export default StoryReel
